import './Table.css';

function Table({data}) {
    const renderTableData = (object) => {
        return object.map((data) => {
            return  <td>{data}</td>;
        });
    }
    return (
        <>
            <table id="Info">
                <thead>
                    <tr>
                        <th>First Name</th>
                        <th>Last Name</th>
                    </tr>
                </thead>
                <tbody>
                    { data &&   
                        data.map(value => {
                            return <tr>{renderTableData(value.data)}</tr>;
                        })
                    }
                </tbody>
            </table>
        </>
    )
}
export default Table;
